import React, {Component} from 'react';
import Binario from "./Binario";
import Altro from "./Altro";

class Nav extends Component {
    render() {
        return (
            <div className='nav'>
                <Binario/>
                <Altro/>
            </div>
        );
    }
}

export default Nav;
